import axios from 'axios';

export const newVisitor = async newVisitor => {
    try {
    const response = await axios
      .post('visitors/new_visitor', {
        first_name: newVisitor.first_name,
        last_name: newVisitor.last_name,
        email: newVisitor.email,
        phone: newVisitor.phone,
        company_name: newVisitor.company_name,
        password: newVisitor.password
      });
    console.log('Visitor Logged');
  } catch (err) {
    console.log(err);
  }
  }
